import React, { Component } from 'react';
import MapContainer from './Map';


class Location extends Component {
    render(){
        return(
            <div id="map-container" className="container-md">
                <h3 id="map-title">WHERE AM I?</h3>
                <MapContainer />
            </div>
        )
    }
}

export default Location;
